// src/components/Navbar.js
import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";

export default function Navbar() {
  const navigate = useNavigate();
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [menuOpen, setMenuOpen] = useState(false);

  useEffect(() => {
    const token = localStorage.getItem("token");
    setIsLoggedIn(!!token);
  }, []);

  const handleLogout = () => {
    localStorage.removeItem("token");
    setIsLoggedIn(false);
    navigate("/login");
  };

  const getLinkStyle = (requiresLogin = false) => ({
    color: requiresLogin && !isLoggedIn ? "#aaa" : "#fff",
    textDecoration: "none",
    fontWeight: requiresLogin && !isLoggedIn ? "400" : "500",
    pointerEvents: requiresLogin && !isLoggedIn ? "none" : "auto",
    cursor: requiresLogin && !isLoggedIn ? "default" : "pointer",
  });

  return (
    <nav style={styles.navbar}>
      {/* LEFT SIDE (Logo + Links) */}
      <div style={styles.leftSection}>
        <Link to="/" style={{ color: "#fff", textDecoration: "none", fontWeight: "bold", fontSize: "1.3em" }}>
          QuizApp
        </Link>

        {/* Hamburger Button (mobile only) */}
        <button style={styles.hamburger} onClick={() => setMenuOpen(!menuOpen)}>
          â˜°
        </button>

        {/* Left Links */}
        <div
          style={{
            ...styles.leftLinks,
            ...(menuOpen ? styles.showMenu : {}),
          }}
        >
          <Link style={getLinkStyle(true)} to="/dashboard">Dashboard</Link>
          <Link style={getLinkStyle(true)} to="/leaderboard">Leaderboard</Link>
          <Link style={getLinkStyle(true)} to="/past-quizzes">Past Quizzes</Link>
          <Link style={getLinkStyle(true)} to="/upcoming-quizzes">Upcoming Quizzes</Link>
          <Link style={getLinkStyle(true)} to="/profile">Profile</Link>
        </div>
      </div>

      {/* RIGHT SIDE */}
      <div
        style={{
          ...styles.rightSection,
          ...(menuOpen ? styles.showMenu : {}),
        }}
      >
        {!isLoggedIn && (
          <>
            <Link style={getLinkStyle()} to="/login">Login</Link>
            <Link style={getLinkStyle()} to="/signup">Signup</Link>
          </>
        )}
        <Link style={getLinkStyle()} to="/settings">Settings</Link>
        {isLoggedIn && (
          <button style={styles.logoutBtn} onClick={handleLogout}>
            Logout
          </button>
        )}
      </div>
    </nav>
  );
}

const styles = {
  navbar: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "10px 20px",
    backgroundColor: "#2575fc",
    color: "#fff",
    position: "sticky",
    top: 0,
    zIndex: 100,
    flexWrap: "wrap",
  },
  leftSection: {
    display: "flex",
    alignItems: "center",
    gap: "20px",
    flex: 1,
  },
  leftLinks: {
    display: "flex",
    alignItems: "center",
    gap: "15px",
  },
  rightSection: {
    display: "flex",
    alignItems: "center",
    gap: "15px",
  },
  logoutBtn: {
    backgroundColor: "#ff4d4f",
    border: "none",
    padding: "5px 10px",
    borderRadius: "5px",
    cursor: "pointer",
    color: "#fff",
    fontWeight: "bold",
  },
  hamburger: {
    display: "none",
    fontSize: "1.6em",
    background: "none",
    border: "none",
    color: "white",
    cursor: "pointer",
  },
  showMenu: {
    display: "flex",
    flexDirection: "column",
    position: "absolute",
    top: "60px",
    left: 0,
    right: 0,
    backgroundColor: "#2575fc",
    padding: "15px",
    gap: "10px",
  },
  /* Responsive */
  "@media (max-width: 768px)": {
    leftLinks: { display: "none" },
    rightSection: { display: "none" },
    hamburger: { display: "block" },
  },
};
